export const courseThumbnails = {
  reactNative: require('./thumbnails/react-native.png'),
  javascript: require('./thumbnails/javascript.png'),
  python: require('./thumbnails/python.png'),
  webDev: require('./thumbnails/web-dev.png'),
  mobileDev: require('./thumbnails/mobile-dev.png'),
  dataScience: require('./thumbnails/data-science.png'),
} as const;

// Fallback image for when thumbnails fail to load
export const fallbackThumbnail = require('./thumbnails/fallback.png');
